@import url("https://fonts.googleapis.com/css2?family=Jura:wght@300;400;500;600;700&display=swap");

@import url("https://fonts.googleapis.com/css2?family=Jura:wght@300;400;500;600;700&family=Poppins:ital,wght@0,200;0,300;0,400;1,200;1,300&display=swap");
/* Common styles */

* {
  margin: 0;
  padding: 0;
  text-decoration: none;
  list-style-type: none;
  outline: none;
  font-family: Jura;
}

html {
  font-size: 62.5%;
}

.center {
  display: flex;
  justify-content: center;
  align-items: center;
}

/* End of Common styles */

/* Mouse Circle */
.mouse-circle,
.mouse-dot {
  border-radius: 50%;
  position: fixed;
  z-index: 300;
  transform: translate(-50%, -50%);

  /* To work  hover effect */
  pointer-events: none;
}
.mouse-circle {
  width: 6rem;
  height: 6rem;
  border: 0.1rem solid #c7a622;
  animation: mouseCircleAnim 5s infinite linear;
}

@keyframes mouseCircleAnim {
  0% {
    width: 6rem;
    height: 6rem;
  }
  25% {
    width: 8rem;
    height: 8rem;
  }
  35% {
    width: 4rem;
    height: 4rem;
  }
  70% {
    width: 8rem;
    height: 8rem;
  }
  100% {
    width: 6rem;
    height: 6rem;
  }
}

.mouse-dot {
  width: 0.5rem;
  height: 0.5rem;
  background-color: #9b0e0e;
  animation: mouseDotAnim 10s infinite linear;
}

@keyframes mouseDotAnim {
  0% {
    width: 0.5rem;
    height: 0.5rem;
  }
  25% {
    width: 1.5rem;
    height: 1.5rem;
  }
  35% {
    width: 0.5rem;
    height: 0.5rem;
  }
}

/* Page BG */
.page-bg {
  position: fixed;
  width: 100%;
  height: 100vh;
  background: linear-gradient(rgb(0, 0, 0, 0.7), rgba(0, 0, 0, 7)),
    url(/7d11113407263d50449183f743bfd8b0.jpg);
  background-size: cover;
}
/* End of BG */

/* Logo */

.logo {
  position: absolute;
  top: 2rem;
  left: 5rem;
  font-size: 2rem;
  text-transform: uppercase;
  color: #fff;
}

/* End of Logo */

/* Section 1 */
.section-1 {
  position: relative;
  width: 100%;
  height: 100vh;
  /* display: flex; */
  justify-content: center;
  align-items: center;
}

/* Animated Circles */

.circles {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  grid-template-rows: repeat(2, 1fr);
}

.circle {
  width: 22rem;
  height: 22rem;
  border-radius: 50%;
  background-color: red;
  align-self: center;
  justify-self: center;
  opacity: 0.5;
  position: relative;

  /* Transitions with mouseevent */
  transition: left 2s, top 2s;
  /* Initial state */
  top: 0;
  left: 0;
}

.circle-1 {
  background: url(/1ddc6f9bd2dd9690b1cd21319767815c.jpg) center no-repeat;
  background-size: cover;
  background-clip: content-box;
  border: 0.5rem dotted #a14b1a;
}

.circle-2 {
  background: url(/c78e47ea42571f77537024e18cba8388.jpg) center no-repeat;
  background-size: cover;
  background-clip: content-box;
  border: 0.5rem dashed #ffbd07;
}
.circle-3 {
  background: url(/6b26673dea0b2ce5c29ab939a363876d.jpg) center no-repeat;
  background-size: cover;
  background-clip: content-box;
  border: 1rem double #9b0e0e;
}
.circle-4 {
  background: url(/5b55dc466d8eb5a2b6768d071761df32.jpg) center no-repeat;
  background-size: cover;
  background-clip: content-box;
  border: 0.7rem double #fff;
}

.main-circle {
  width: 55rem;
  height: 55rem;
  position: absolute;
  overflow: hidden;
  border-radius: 50%;
  transition: width 0.2s, height 0.2s;
}

.main-circle:hover {
  width: 75rem;
  height: 75rem;
}

.main-circle img {
  mix-blend-mode: color-dodge;
  position: relative;

  /* Transitions with mouseevent */
  transition: left 2s, top 2s;

  /* Initial state */
  top: 0;
  left: 0;
}

/* End of Animated Circles */

/* Featured Text */

.featured-text {
  background: red;
  font-size: 2rem;
  color: #fff;
  text-transform: uppercase;
  /* Vertial words */
  width: 0;
  word-wrap: break-word;
  line-height: 3.5;

  /* sticky on the top*/
  position: sticky;
  top: 0;
}

.featured-text-1 {
  margin: 0 auto 0 10rem;
}

.featured-text-2 {
  margin: 0 10rem 0 auto;
}

/* End of Featured Text */

/* Main Button */
.main-btn {
  position: absolute;
  bottom: 3rem;
  width: 13rem;
  height: 13rem;
  background-color: #9b0e0e;
  border-radius: 50%;
  border: 0.2rem dotted #fff;
  padding: 0.1rem;
}

.main-btn-content {
  width: 100%;
  height: 100%;
  border: 0.2rem dotted #e7be08;
  border-radius: 50%;
  transform: rotate(40deg);
}

.main-btn-line {
  position: absolute;
  top: 4rem;
  width: 3rem;
  height: 0.5rem;
  border: 0.1rem solid #fff;
}

.main-btn-line:nth-child(1) {
  transform: rotateZ(-45deg) translateX(-0.65rem);
  transform-origin: left center;
  border-right: none;
}

.main-btn-line:nth-child(2) {
  transform: rotateZ(45deg) translateX(0.65rem);
  transform-origin: right center;
  border-left: none;
}

.main-btn-line:nth-child(3) {
  transform: rotateZ(90deg) translateX(0.5rem);

  border-left: none;
}

.main-btn span {
  position: absolute;
  bottom: 3rem;
  color: #fff;
  font-size: 1.1rem;
  font-weight: 600;
  text-transform: uppercase;
}

/* End of section 1 */

